import React from "react";
import axios from "axios";
import cheerio from "cheerio";

type Props = {
  children: React.ReactNode;
}


export const DataContext = React.createContext(undefined);

const Scrapper: React.FC<Props> = async ({ children }) => {

  const url = 'http://webcode.me';

const response = await fetch(url);
const body = await response.text();

  const data:any = [];
  axios
    .get("https://podzial.mech.pk.edu.pl/")
    .then((urlResponse) => {
      const $ = cheerio.load(urlResponse.data);
      const x = urlResponse.data

      // console.log(cheerio.load(urlResponse.data))

      $("div").each((i, element) => {
        console.log(element)
        data.push(element);
      });
    })
    .catch((e) => console.log(e));
  return (
    <DataContext.Provider value={data}>
        {children}
    </DataContext.Provider>
  );
};

export default Scrapper;
